-- PHARMACY POS V6.0 - MYSQL READY
CREATE DATABASE IF NOT EXISTS pmdb;
USE pmdb;
SET FOREIGN_KEY_CHECKS = 0;
DROP TABLE IF EXISTS invoice_details;
DROP TABLE IF EXISTS invoices;
DROP TABLE IF EXISTS inventory;
DROP TABLE IF EXISTS batches;
DROP TABLE IF EXISTS pharmacists;
DROP TABLE IF EXISTS customers;
DROP TABLE IF EXISTS medicines;
DROP TABLE IF EXISTS categories;
DROP TABLE IF EXISTS branches;
SET FOREIGN_KEY_CHECKS = 1;

CREATE TABLE branches (branch_id INT PRIMARY KEY AUTO_INCREMENT, branch_name VARCHAR(100) NOT NULL, address VARCHAR(255), phone_number VARCHAR(20)) ENGINE=InnoDB;
CREATE TABLE categories (category_id INT PRIMARY KEY AUTO_INCREMENT, category_name VARCHAR(100) NOT NULL) ENGINE=InnoDB;
CREATE TABLE medicines (medicine_id INT PRIMARY KEY AUTO_INCREMENT, category_id INT, name VARCHAR(255) NOT NULL, brand VARCHAR(100), base_unit VARCHAR(50), sub_unit VARCHAR(50), conversion_rate INT, base_sell_price DECIMAL(15,0), sub_sell_price DECIMAL(15,0), created_at TIMESTAMP DEFAULT CURRENT_TIMESTAMP) ENGINE=InnoDB;
CREATE TABLE pharmacists (pharmacist_id INT PRIMARY KEY AUTO_INCREMENT, branch_id INT, username VARCHAR(50) UNIQUE, password VARCHAR(255), full_name VARCHAR(100), role VARCHAR(20)) ENGINE=InnoDB;
CREATE TABLE customers (customer_id INT PRIMARY KEY AUTO_INCREMENT, phone_number VARCHAR(20) UNIQUE, customer_name VARCHAR(100)) ENGINE=InnoDB;
CREATE TABLE batches (batch_id INT PRIMARY KEY AUTO_INCREMENT, medicine_id INT, batch_number VARCHAR(50) NOT NULL, manufacturing_date DATE, expiry_date DATE NOT NULL, import_price_package DECIMAL(15,0)) ENGINE=InnoDB;
CREATE TABLE inventory (inventory_id INT PRIMARY KEY AUTO_INCREMENT, branch_id INT, batch_id INT, quantity_std INT NOT NULL, last_updated TIMESTAMP DEFAULT CURRENT_TIMESTAMP) ENGINE=InnoDB;
CREATE TABLE invoices (invoice_id INT PRIMARY KEY AUTO_INCREMENT, branch_id INT, pharmacist_id INT, customer_id INT NULL, total_amount DECIMAL(15,0), sale_date TIMESTAMP, source_type ENUM('MANUAL', 'SIMULATED')) ENGINE=InnoDB;
CREATE TABLE invoice_details (detail_id INT PRIMARY KEY AUTO_INCREMENT, invoice_id INT, batch_id INT, unit_sold VARCHAR(50), quantity_sold INT, unit_price DECIMAL(15,0), total_std_quantity INT) ENGINE=InnoDB;

